/*  API/getCourses.js
    Robin Marillia

    Recupere les todos depuis un site distant
*/

function getTodos(callback){

    fetch("http://www.mocky.io/v2/5ebab22a3600006100f7e279",{
        method: 'GET',
        headers: {
            Accept: 'application/json',
        },
    } 
      ).then(function(response) {

        return response.text()
      }).then(function (value) {

            //var json = JSON.parse({value})
            // const words = value.split("[");

            var test = value.replace( '[', '' );
            var test2 = test.replace( ']', '' );
            // console.log(JSON.parse(test2))

            console.log(test2)
            callback(value)
      })
}

export default getTodos
